import React, { Component } from 'react'

export class AccountPage extends Component {
    constructor(props) {
        super(props);
        this.state = { userName: props.userName }
    }

    render() {
        return (
            <div>
                <h3>Welcome {this.state.userName}</h3>
            </div>
        )
    }
}

export default AccountPage
